import React from "react";
import {
    Container,
    Row,
    Column
} from "../index";

//5454cb1b9be0477fb63a1b9fc15db6eb - API key

const News = (props) => {
    let url = 'https://newsapi.org/v2/top-headlines?' +
        'country=us&' +
        'apiKey=5454cb1b9be0477fb63a1b9fc15db6eb';
    fetch(url)
        .then(response => {
           return response.json();
        })
        .then(({data}) => {
            let news = data.articles;
        });

    return (
        <Container>
            <Row>
                <Column>
                    <div>
                        <h2>{news}</h2>
                    </div>
                </Column>
            </Row>
        </Container>
    )
};

export default News;
